#kmp algorithm O(m+n)
class Solution:
    def strStr(self, haystack: str, needle: str) -> int:
        if not needle: return 0
        def kmp(pattern):
            arr = [0]*len(pattern)
            i, j = 1, 0
            while i<len(pattern):
                if pattern[i] == pattern[j]:
                    arr[i] = j + 1
                    j += 1
                else:
                    if j-1 >= 0:
                        j = arr[j-1]
                        continue
                i += 1
            return arr
        arr = kmp(needle)

        j = 0
        i = 0
        while i < len(haystack):
            if j < len(needle) and haystack[i] == needle[j]:
                j += 1
            else:
                if j-1>=0:
                    j = arr[j-1]
                    continue
                else:
                    j = 0
            i += 1
            if j == len(needle):
                return i-len(needle)
        return -1


